[{"name": "mcp__ols__search", "input": {"query": "oxidoreductase NAD cofactor"}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "NAD+ oxidoreductase", "limit": 50}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "NAD+ oxidoreductase", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "oxidoreductase NAD", "ontologyId": "go", "pageSize": 20}}, {"name": "mcp__pubdictionaries__find_ids", "input": {"labels": "lactate dehydrogenase, alcohol dehydrogenase, malate dehydrogenase, isocitrate dehydrogenase, glutamate dehydrogenase", "dictionary": "MESH"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?reaction ?equation ?ecNumber
WHERE {
  ?reaction rh:equation ?equation ;
            rh:ec ?ec .
  ?ec rdfs:label ?ecNumber .
  FILTER (CONTAINS(?equation, "NAD(+)"))
  FILTER (regex(?ecNumber, "^1\\."))
}
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?rheaId ?equation ?ecLabel
WHERE {
  ?reaction rh:accession ?rheaId ;
            rh:equation ?equation ;
            rh:ec ?ec .
  ?ec rdfs:label ?ecLabel .
  FILTER (CONTAINS(STR(?equation), "NAD(+)"))
  FILTER (regex(?ecLabel, "^1\\."))
}
LIMIT 25"}}, {"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0016651"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?reaction) as ?count)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:ec ?ec .
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?variant ?label ?accession ?num_submitters ?variation_type
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:accession ?accession ;
           cvo:number_of_submitters ?num_submitters ;
           cvo:variation_type ?variation_type ;
           cvo:record_status "current" .
}
ORDER BY DESC(?num_submitters)
LIMIT 1"}}]

[{"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "Osimertinib", "limit": 5}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT ?molecule ?label ?chemblId ?developmentPhase
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?molecule a cco:SmallMolecule ;
            rdfs:label ?label ;
            cco:chemblId ?chemblId ;
            cco:highestDevelopmentPhase ?developmentPhase .
  FILTER(?chemblId = "CHEMBL3353410")
}
LIMIT 10"}}]
